import { Link, Route, Routes } from "react-router-dom";

export default function BankApp() {
  return (
    <Routes>
      <Route path="/test" element={<BankComponent />} />
    </Routes>
  );
}

function BankComponent() {
  return (
    <div>
      <h1>
        <Link to={"/check"}>One</Link>
      </h1>
      <h1> two</h1>
    </div>
  );
}
